 "Enter an RSS URL for the RSS feed you \nwant to attach to your content. Feeds are often identified by a small graphic\n icon (often like this <img src=\"\/images\/feed-icon.png\" \/>) or the text \"RSS\". Clicking on the \n icon or text label will display an RSS feed right in your browser. You can copy and paste the\nURL into this field. Alternately, right clicking on the link or graphic will open a menu box;\nclick on COPY LINK LOCATION or Copy Shortcut. Back in eXe open the RSS bookmark iDevice and Paste the URL \ninto the RSS URL field and click the LOAD button. This will extract the titles from your feed and\ndisplay them as links in your content. From here you can edit the bookmarks and add\n instructions or additional learning information.": "Inserire un URL RSS per l'RSS feed che \nsi vuole in allegato ai contenuti. I feed sono spesso identificati da una piccola\nicona (spesso come questa <img src=\"\/images\/feed-icon.png\" \/>) o il testo \"RSS\". Premendo \nsull'icona o sul testo \"RSS\" verr\u00e0 visualizzato il feed RSS sulla destra del browser. Si pu\u00f2 copiare\ne incollare l'URL in questo campo. In alternativa, premere con il tasto destro sul link o sull'icona \nper aprire il men\u00f9 contestuale; premere su COPIA LINK o copia scorciatoia. Tornare in eXe, \naprire l'RSS iDevice, copiare l'URL nel campo RSS URL e premere il pulsante CARICA. \nQuesto carica i titoli dal feed scelto e li elenca come link nel contenuto della pagina. \nDa qui \u00e8 possibile modificare i segnalibri ed aggiungere istruzioni o ulteriori informazioni didattiche.", 
