 "Reflection is a teaching method often used to \nconnect theory to practice. Reflection tasks often provide learners with an \nopportunity to observe and reflect on their observations before presenting \nthese as a piece of academic work. Journals, diaries, profiles and portfolios \nare useful tools for collecting observation data. Rubrics and guides can be \neffective feedback tools.": "La riflessione \u00e8 un metodo d'insegnamento usato spesso per \ncollegare la teoria alla pratica. I compiti di riflessione forniscono \nspesso agli studenti un'occasione per osservare e riflettere sulle loro \nosservazioni, prima di presentare queste come parte di lavoro \naccademico. Le pubblicazioni, i diari, i profili sono mezzi utili alla \nraccolta dei dati di osservazione. Gli elenchi e le guide possono \nessere mezzi efficaci per la valutazione.", 
