 "Type in the feedback that you want the \nstudent to see when selecting the particular question. If you don't complete\nthis box, eXe will automatically provide default feedback as follows: \n\"Correct answer\" as indicated by the selection for the correct answer; or \n\"Wrong answer\" for the other alternatives.": "Scrivere le informazioni che si vogliono visualizzare \nallo studente quando seleziona una particolare domanda. Se non si completa \nquesto campo, eXe  fornir\u00e0\u00a0 automaticamente un'informazione predefinita del tipo: \n\"Risposta corretta\"  per indicare la selezione di una risposta corretta; oppure \n\"Risposta sbagliata\" per le altre alternative.", 
