 "Please fill in this field: '%s'.": "Completare questo campo: '%s'.", 
 "Insert Column After": "Inserisci colonna dopo", 
 "<dl>  <dt>If your goal is to test understanding of core concepts or reading comprehension  <\/dt>  <dd>    <p>  Write a summary of the concept or reading long  enough to adequately test the target's knowledge, but short enough not to induce fatigue. Less than one typed page is probably adequate, but probably considerably less for young students or beginners.    <\/p>    <p>Choose words in the text thatare key to understanding the concepts. Thesewill probably be verbs, nouns, and key adverbs.Choose alternatives with one clear answer.    <\/p>  <\/dd>  <dt>If your goal is to test vocabulary knowledge  <\/dt>  <dt>If your goal is to test word formation\/grammar:  <\/dt>  <dd>  <p>Write a text using the target forms. This text should be coherent and cohesive, and be of an appropriate length. Remember that the goal is not vocabulary knowledge, so the core meanings of the stem words should be well known to the students.  <\/p>  <p>Highlight the target words in the text. Provide alternatives with the same word stem, but different affixes. It is a good idea to get a colleague to test the test\/exercise to make sure there are no surprises!  <\/p>  <\/dd><\/dl>": "<dl><dt>Se l'obiettivo \u00e8 verificare la comprensione di concetti chiave o la comprensione della lettura <\/dt> <dd> <p> Scrivere un riassunto dei concetti o una lettura abbastanza lunga da verificare adeguatamente le conoscenze in oggetto, ma abbastanza corta da non affaticare. Meno di una pagina \u00e8 probabilmente abbastanza, ma sar\u00e0 molto meno per studenti giovani o principianti.  <\/p>  <p>Scegliere per il testo parole che siano fondamentali per la comprensione dei concetti. Saranno probabilmente verbi, nomi e avverbi chiave. Scegliere le alternative con una risposta chiaramente corretta.   <\/p> <\/dd> <dt>Se l'obiettivo \u00e8 di verificare la comprensione lessicale <\/dt>  <dt>Se l'obiettivo \u00e8 di verificare la produzione\/grammatica:  <\/dt> <dd> <p>Scrivere un testo usando le forme oggetto di verifica. Il testo dovrebbe essere coerente e di lunghezza appropriata. Ricordare che l'obiettivo non \u00e8 la conoscenza lessicale e quindi il significato delle parole chiave dovrebbe essere ben noto agli studenti. <\/p> <p>Evidenziare le parole chiave nel testo. Fornire alternative con la stessa radice ma con suffissi diversi. \u00c8 una buona idea chiedere ad un\/una collega di provare la verifica per assicurarsi che non ci siano sorprese! <\/p> <\/dd><\/dl>", 
