 "A case study is a device that provides learners \nwith a simulation that has an educational basis. It takes a situation, generally \nbased in reality, and asks learners to demonstrate or describe what action they \nwould take to complete a task or resolve a situation. The case study allows \nlearners apply their own knowledge and experience to completing the tasks \nassigned. when designing a case study consider the following:<ul> \n<li>\tWhat educational points are conveyed in the story<\/li>\n<li>\tWhat preparation will the learners need to do prior to working on the \ncase study<\/li>\n<li>\tWhere the case study fits into the rest of the course<\/li>\n<li>\tHow the learners will interact with the materials and each other e.g.\nif run in a classroom situation can teams be setup to work on different aspects\nof the case and if so how are ideas feed back to the class<\/li><\/ul>": "Studio di un caso \u00e8 un iDevice che fornisce agli studenti \nmediante una simulazione, contenuti che hanno basi educative. Esso esamina una situazione, generalmente \nbasata sulla realt\u00e0, e richiede agli studenti di dimostrare o descrivere quali azioni essi \ndovrebbero intraprendere per completare un lavoro o risolvere una situazione. Uno studio permette \nagli studenti di applicare le loro personali conoscenze ed esperienze per completare i lavori assegnati. \nQuando si progetta uno studio di caso bisogna considerare:<ul> \n<li>\tQuali elementi educativi sono coinvolti nel caso esaminato<\/li>\n<li>\tQuale preparazione dovrebbero avere gli studenti prima di affrontare il caso<\/li> \n<li>\tIn che modo il caso di studio si collega con il resto del corso<\/li> \n<li>\tCome gli studenti interagiranno con i materiali e tra loro es.: \nin una situazione di classe \u00e8 possibile creare gruppi di lavoro ed assegnare \nad essi diversi aspetti, ed in questo caso decidere come diffondere le idee nella classe.<\/li><\/ul>", 
