 "<p>The reading activity, as the name \nsuggests, should ask the learner to perform some form of activity. This activity \nshould be directly related to the text the learner has been asked to read. \nFeedback to the activity where appropriate, can provide the learner with some \nreflective guidance.<\/p>": "<p>L'attivit\u00e0\u00a0di lettura, come il nome \nsuggerisce, dovrebbe aiutare lo studente ad eseguire alcune forme di attivit\u00e0. \nQueste attivit\u00e0 dovrebbero essere direttamente correlate con il testo dato da \nleggere allo studente. Le valutazioni dell'attivit\u00e0, quando sono appropriate, \npossono fornire allo studente alcune indicazioni di riflessione.<\/p>", 
