 "Table Properties": "Propriet\u00e0 tabella", 
 "<p>\nThe image with text iDevice can be used in a number of ways to support both\nthe emotional (affective) and learning task (cognitive) dimensions of eXe\ncontent. \n<\/p><p>\n<b>Integrating visuals with verbal summaries<\/b>\n<\/p><p>\nCognitive psychologists indicate that presenting learners with a\nrepresentative image and corresponding verbal summary (that is presented\nsimultaneously) can reduce cognitive load and enhance learning retention.\nThis iDevice can be used to present an image (photograph, diagram or\ngraphic) with a brief verbal summary covering the main points relating to\nthe image. For example, if you were teaching the functions of a four-stroke\ncombustion engine, you could have a visual for each of the four positions of\nthe piston with a brief textual summary of the key aspects of each visual.\n<\/p>": "<p>\nL'iDevice Immagine con testo pu\u00f2 essere usato in diversi modi per sostenere\nsia la dimensione emozionale (affettiva) che di apprendimento \n(cognitiva) dei contenuti di eXe. \n<\/p><p>\n<b>Come integrare la visione con commenti verbali<\/b>\n<\/p><p>\nGli psicologi cognitivi affermano che presentare agli studenti una\nimmagine rappresentativa con il corrispondente commento verbale (presentati\ncontemporaneamente) pu\u00f2  ridurre il carico cognitivo ed aumentare la fissazione delle conoscenze.\nQuesto iDevice pu\u00f2 essere utilizzato per presentare una immagine (fotografia, diagramma o\ngrafico) con un breve commento verbale che includa i principali punti di relazione con\nl'immagine. Per esempio, se si sta insegnando il funzionamento di un motore\na quattro tempi, si dovrebbe visualizzare un'immagine per ciascuna delle quattro posizioni del pistone\ncon un breve commento per gli aspetti chiave di ciascuna immagine.\n<\/p>", 
 "Package exported to <a href=\"%s\" target=\"_blank\" title=\"Click to view the exported package\">%s<\/a>.": "Pacchetto esportato in <a href=\"%s\" target=\"_blank\" title=\"Clic per vedere il pacchetto esportato\">%s<\/a>.", 
 "Creative Commons Attribution Non-commercial No Derivatives License 2.5": "Licenza Creative Commons Attribution Non-commercial No Derivatives 2.5", 
 "<p>Cloze exercises are texts or sentences where students must fill in missing words. They are often used for the following purposes:<\/p><ol><li>To check knowledge of core course concepts (this could be a pre-check, formative exercise, or summative check).<\/li><li>To check reading comprehension.<\/li><li>To check vocabulary knowledge.<\/li><li>To check word formation and\/or grammatical competence. <\/li><\/ol>": "<p>Gli esercizi cloze sono testi o frasi in cui gli studenti devono inserire le parole mancanti. Essi sono spesso utilizzati per i seguenti obiettivi:<\/p><ol><li>Verificare la conoscenza dei concetti base del corso (potrebbero essere verifiche preliminari, esercizi formativi o verifiche sommative).<\/li><li>Per verificare la comprensione della lettura.<\/li><li>Per verificare la conoscenza lessicale.<\/li><li>Per verificare la produzione scritta e\/o le competenze grammaticali. <\/li><\/ol>", 
